INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 24001, 24, 401, 2, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "アヤネ", 0.0, 102301, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 24002, 24, 402, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "アヤネ", 2.21, 102301, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 24003, 24, 403, 2, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "アヤネ", 0.0, 102301, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 24004, 24, 701, 2, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "アサヒ", 1.99, 192201, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 24005, 24, 702, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "アサヒ", 2.21, 192201, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 24006, 24, 703, 2, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "アサヒ", 3.33, 192201, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 24007, 24, 801, 2, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "部員３", 0.0, 192301, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 24008, 24, 802, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "部員３", 2.68, 192301, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 24009, 24, 803, 2, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "部員３", 0.0, 192301, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "やった！", 24010, 24, 501, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "", 0.0, 192501, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "勝ったよ！", 24011, 24, 502, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "", 0.0, 192501, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "いい調子！", 24012, 24, 503, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "", 0.0, 192501, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 24013, 24, 111, 6, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ミサト", 5.33, 113501, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 24014, 24, 112, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ミサト", 6.85, 113501, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 24015, 24, 113, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ミサト", 3.0, 113501, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 24016, 24, 611, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ダイチ", 6.11, 192401, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 24017, 24, 612, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ダイチ", 6.75, 192401, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 24018, 24, 613, 2, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ダイチ", 0.0, 192401, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 24019, 24, 211, 2, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ハツネ", 4.52, 113401, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 24020, 24, 212, 2, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ハツネ", 3.89, 113401, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 24021, 24, 213, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ハツネ", 13.49, 113401, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 24022, 24, 311, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "カヤ", 3.17, 106501, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 24023, 24, 312, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "カヤ", 4.42, 106501, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 24024, 24, 313, 6, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "カヤ", 2.89, 106501, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 24025, 24, 421, 4, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "アヤネ", 3.71, 102301, 3);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 24026, 24, 721, 2, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "アサヒ", 5.1, 192201, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 24027, 24, 821, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "部員３", 4.34, 192301, 3);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "いい勝負だったよ\nまたやろうね", 24028, 24, 521, 1, 10046, 0.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "", 0.0, 192501, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 24029, 24, 101, 1, 10046, -360.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ミサト", 5.62, 113501, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 24030, 24, 102, 1, 10046, -360.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ミサト", 9.58, 113501, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 24031, 24, 103, 2, 10046, -360.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ミサト", 0.0, 113501, 2);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 24032, 24, 104, 2, 10046, -360.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ミサト", 9.13, 113501, 1);
INSERT INTO `v1_841bbf01821973782adb678df4b88f379bb31208a3fdf5789d340ed60ff11b50` VALUES (0.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 24033, 24, 105, 1, 10046, -360.0, "2030/12/17 14:59:59", "2020/07/31 12:00:00", "ミサト", 8.27, 113501, 2);
